import React from 'react';

const Header = () => {
    return (
        <header className='container'>
            <nav className='navigation'>
                <div className='logo'>
                    <h2>ЛОГОТИП</h2>
                </div>
                <ul className='menu_box'>
                    <li><p>Туры</p></li>
                    <li><p>O нас</p></li>
                    <li><p>Подбор Тура</p></li>
                    <li><p>Контакты</p></li>
                </ul>
            </nav>
        </header >


    );
};

export default Header;
